import React from "react";
import Header from "../components/Header";
import WineBottle from "../PageComponents/WineBottle";
import Footer from "../components/Footer";

const mock = [
  {
    date: "2020.7.1",
    name: "MAKASHIVILI WINE CELLAR KISI",
    category: "white",
    home: "Georgia",
  },
];

const layoutStyle = {
  marginLeft: "auto",
  marginRight: "auto",
  background: "beige",
  fontFamily: "YuMincho",
  letterSpacing: 3,
  fontWeight: 300,
  fontColor: "lightgray",
};

const bottleStyle = {
  display: "flex",
  flexWrap: "wrap",
};

export default (mock) => (
  <div style={layoutStyle}>
    <Header />

    <div style={bottleStyle}>
      <WineBottle
        date={mock.date}
        name={mock.name}
        category={mock.category}
        home={mock.home}
      />
    </div>
    <Footer />
  </div>
);
